import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Navbar from '../../layouts/frontend/Navbar';
import publicRoutesList from '../../routes/Publicroutelist'; // Ensure this path is correct
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.js';

const FrontendLayout = (props) => {
    return (
        <div>
            <Navbar />
            <div>
                <Switch>
                    {publicRoutesList.map((routedata, idx) => (
                        <Route 
                            key={idx}
                            path={routedata.path}
                            exact={routedata.exact}
                            render={routeProps => {
                                // Debugging log to check which component is being rendered
                                console.log('Rendering component:', routedata.component);
                                return (
                                    <routedata.component {...routeProps} {...props} />
                                );
                            }}
                        />
                    ))}
                </Switch>
            </div>
        </div>
    );
}

export default FrontendLayout;
